import React, { Component } from "react";
import Menu from "../../menu/menu";
import api from "../../../services/api";
import Table from '../../../utils/table/table';



export default class showBillingResumed extends Component {
    constructor(){
        super();
        this.state = {
            contentData: []
        }
    }

    componentDidMount = async () => {
        this.showBilling();
    }

    showBilling = async (page=1) => {
        const response = await api.get(`/fechamentos/${page}`);
        console.log(response);
        const { Data } = response.data;
        this.setState({ contentData: Data });
    }
    

    render(){
        const { contentData } = this.state;
        console.log("Datasss", contentData);
        return (
            <div className="main">
                <div className="menu">
                    <Menu />
                </div>
                <h1>Faturamentos Realizados</h1>
                <div className="table">
                        {contentData.map( data => (
                            <article key={data.table_name}>
                                {data.create_time}
                                {data.table_name}
                                {data.table_rows}
                                {data.table_schema}
                            </article>
                        ))}
                </div>
            </div>

        )
    }
}
